import React from 'react';
import Navbar from '../Global/Navbar/Navbar';
import Searchbar from './Searchbar'
import Border from '../Global/Border'
import Footer from '../Global/Footer'
import Welcome from './'

function Home() {
  return (
    <div className="Home">
      <Navbar />

      <Searchbar/>

      <Border />

      <Welcome />

      <Footer />
    </div>
  );
}

export default Home;
